INSERT INTO `notice` VALUES (16, '鱼你在一起十周年庆', 1, 1, '<p>鱼你在一起创立于2017年，是一家以经营<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E9%85%B8%E8%8F%9C%E9%B1%BC/288202\">酸菜鱼</a>米饭为主的快餐连锁品牌。拥有热炝酸菜鱼、青花椒酸菜鱼、老坛酸菜鱼、公举番茄鱼、酸辣金汤鱼、经典香辣鱼等酸菜鱼系列及热卤、小食、饮品系列。除了实现传统酸菜鱼的小份制、快餐化，更凭借系统化、标准化的经营优势，经过4年多发展，鱼你在一起门店已辐射全国356+座城市。<sup>&nbsp;</sup><img src=\"https://yudianbao.ynzyq.cn/file/1633337199959.jpg\" contenteditable=\"false\" style=\"font-size: 14px; max-width: 100%;\"/></p><br/>', 2, 2, 1, 1, '2021-10-04 16:46:42', '2021-10-07 16:10:52');
INSERT INTO `notice` VALUES (17, '鱼你在一起高铁冠名专列震撼首发，搭载“高铁速度”一路高歌猛进', 2, 1, '<p>十一黄金周到来之际，一列载有鱼你在一起酸菜鱼品牌元素的高铁飞驰在华东大地，成为数以万计乘客们旅途中一道亮眼的风景，大家不仅体验了酸菜鱼这道美食的魅力，更是领略了鱼你在一起品牌实力和布局全国的雄心。<img src=\"https://yudianbao.ynzyq.cn/file/1633589803367.png\" contenteditable=\"false\" style=\"font-size: 14px; max-width: 100%;\"/><br/>作为中国酸菜鱼赛道的领跑企业，鱼你在一起此次重磅冠名高铁专列，是品牌战略和影响力升级的重要表现。随着“鱼你在一起酸菜鱼”专列启程，酸菜鱼赛道将步入“高铁速度”新时代，迎来新的纪元时代。<br/></p><p><img src=\"https://yudianbao.ynzyq.cn/file/1633589815199.png\" style=\"max-width:100%;\" contenteditable=\"false\"/><br/></p><p><strong>高铁冠名，加速品牌全国市场布局</strong><br/>9月28日，鱼你在一起高铁冠名专列首发仪式在上海站隆重举行，此次冠名专列为沪宁线，主要在江浙沪之间运行，并将以上海为中心，深度影响苏州、南京、杭州、宁波、徐州等长三角核心区域，有效辐射全国市场。</p><p><img src=\"https://yudianbao.ynzyq.cn/file/1633589826072.png\" style=\"max-width:100%;\" contenteditable=\"false\"/><br/></p><p>作为华东区重要的铁路干线，沪宁线途经中国城市化程度最高、城镇分布最密集、经济发展水平最高的长三角城市群，连接起上海、杭州、南京，成为“黄金三角”的重要纽带，对拉动经济、布局品牌、开拓市场而言意义非凡。<br/>鱼你在一起此次率先开启“高铁布局”，以沪宁线为切入点与高铁联姻，正是期望借助高铁完成鱼你在一起“以线织网、全面下沉、千城万店、布局全国”的品牌战略。</p><p><img src=\"https://yudianbao.ynzyq.cn/file/1633589836399.png\" style=\"max-width:100%;\" contenteditable=\"false\"/><br/>事实上，在此次高铁冠名动作之前，鱼你在一起已于今年8、9月份先后成立华东分公司和华北分公司，进而提升区域布局密度全面下沉，为品牌实现千城万店遍布全国打好基础。目前，鱼你在一起已形成以总部为中心，以华北、华东两大分公司为根据地的战略网。<br/><br/><strong>千亿赛道，助力酸菜鱼行业高速发展</strong><br/>大家熟知，酸菜鱼作为传统川菜品类，在近些年持续受到消费者青睐，整个品类不仅从川菜中脱颖而出成为一个火爆的细分品类，而且市场份额也在逐年增加。据数据显示，2020年酸菜鱼市场规模达到681亿元，而在2025年市场份额有望突破千亿。<br/></p><img src=\"https://yudianbao.ynzyq.cn/file/1633589848922.png\" style=\"max-width:100%;\" contenteditable=\"false\"/><p>抢滩布局者得天下。鱼你在一起作为酸菜鱼行业的领跑企业，面对竞争激烈和巨大的市场，不仅大刀阔斧开始了全新的品牌化发展道路，今年更是在强化品牌升级和布局方面出重拳、发狠力，致力于为全国广大消费者提供美味、便捷、实惠、安全的酸菜鱼。此次在行业率先开启“高铁布局”，展现了品牌战略与雄心。</p><p><img src=\"https://yudianbao.ynzyq.cn/file/1633589859300.png\" style=\"max-width:100%;\" contenteditable=\"false\"/><br/></p><p>值得一提的是，在自身高速发展的同时，鱼你在一起也在想着如何不断拓宽酸菜鱼赛道，让市场容纳更多品牌，大家共同把酸菜鱼品类做大、做强、做久。截至目前，鱼你在一起已连续举办两届“中国酸菜鱼出品大赛”，并连续五年在央视和多家主流地方卫视黄金时段投放广告，多重营销行动不但能很好弘扬川菜饮食文化，提高酸菜鱼品类的影响力，更能推动和加快酸菜鱼行业升级创新，有助于让更多人了解和认识酸菜鱼。</p><p><img src=\"https://yudianbao.ynzyq.cn/file/1633589868921.png\" style=\"max-width:100%;\" contenteditable=\"false\"/><br/>鱼你在一起品牌创始人魏彤蓉曾表示，鱼你在一起有义务和责任，推动整个酸菜鱼品类向前发展，期望更多人一起把这个品类做大。从品牌创立至今的短短四年时间，鱼你在一起门店已遍布全国三百多座城市，连锁门店数量已突破千家，稳居酸菜鱼品类的头把交椅。<br/><br/><strong>瞄准下沉市场，双线并进谋划千城万店</strong><br/>《2021中国餐饮加盟行业白皮书》指出，连锁主战场呈下沉趋势。一线城市连锁化率已达21.6%，竞争激烈。未来三四五线城市有望成为连锁门店发展的主力城市，下沉市场战略是餐饮行业未来发展的良好机会之一。<br/>并且，各大餐企洞察到了下沉市场这块大蛋糕，也开始纷纷布局。但纵观下沉市场，只有满足下沉市场消费能力的品牌才有更好的发展空间。华莱士、蜜雪冰城、正新鸡排等下沉品牌的成功，也验证了这一特征，就是低客单、高性价比的品牌才能在下沉市场的广阔空间里能更好的发展。<br/></p><p><img src=\"https://yudianbao.ynzyq.cn/file/1633589878809.png\" style=\"max-width:100%;\" contenteditable=\"false\"/><br/>当然，下沉市场作为酸菜鱼品类未来的重大增长点，鱼你在一起也在逐步从全国多点布局转向一线做势能、下沉市场做体量，进而构建“全面开花，有势有量”的战略布局。我们发现，相比正餐酸菜鱼品牌，快餐赛道的鱼你在一起的客单价仅仅为30-40元，在追求极致性价比的下沉市场方面极具优势。<br/>除此之外，此次沪宁线高铁的冠名，将会深度辐射城镇经济更发达的江浙沪，助力鱼你在一起在该地区核心城市提高布局密度，同时更能布局乡镇下沉市场，进而全面提升影响力，逐步实现和完成“千城万店”的战略布局。<br/></p><p><img src=\"https://yudianbao.ynzyq.cn/file/1633589889004.png\" style=\"max-width:100%;\" contenteditable=\"false\"/><br/>机遇与挑战并存，抢滩布局者得天下。无论是成立分公司，还是携手高铁拓展市场提升品牌势能，都昭示着搭乘高铁营销是鱼你在一起品牌战略的一个里程碑事件，势必将其载入发展快车道，用“高铁速度”助推品牌和酸菜鱼品类发展。<br/></p>', 1, 1, 1, 1, '2021-10-07 14:58:16', '2021-10-07 16:11:22');
INSERT INTO `notice` VALUES (18, '三大行动九大措施，鱼你在一起全力打好这场防疫安全战', 1, 1, '<p>&nbsp;2020年初爆发的新冠疫情，让中国餐饮行业遭受了前所未有的重创，除了大部分门店闭店零收入外，有的餐饮企业甚至进入了“停摆”状态。</p><p>虽然疫情来袭凶猛，但仍有一部分餐饮企业依靠强有力的管理体系和成熟的疫情机制，用一系列行动积极应对，不但有效降低了疫情带来的损失，更是从疫情中发现了机会，进而让危机成为转机。</p><p>2月13日，在鱼你在一起创始人魏总的一次公司内部线上分享会中，她就指出<strong>每一次疫情都是对行业的一次考验，同时也是一次行业迭代升级的机遇。面对疫情，不仅要积极应对、快速反应，更要意识到危机就是转机，用心捕捉危机中的转机。</strong><img src=\"https://yudianbao.ynzyq.cn/file/1633592045442.png\" contenteditable=\"false\" style=\"font-size: 14px; max-width: 100%;\"/><br/></p><p>从成立防疫小组，到自觉闭店、免管理费、申请减租......再到门店防疫标准、外卖半成品等疫情应对机制，鱼你在一起每一个疫情应对措施都井然有序。相比海底捞、西贝莜面村、肯德基、麦当劳等国内外一线大品牌，鱼你在一起还很年轻。但是也缘何能在此次疫情中，由内之外，从上至下全面做好疫情从容应对呢？</p><p><strong>扎根餐饮16年，历经多次疫情得以从容应对</strong></p><p>在魏总的分享中，提出虽然鱼你在一起诞生于2017年初，但是集团公司已然从事餐饮16年，创始人团队不仅经历过非典、禽流感等多次疫情事件，更是在2013年全国爆发的“禽流感”疫情中，魏老香鸡火锅通过疫情期间开发新品等系列举措力挽狂澜，实现了门店生意130-150%的增长。</p><p>由此可见，<strong>强有力的管理体系和成熟的疫情机制，以及丰富的疫情实战经历</strong>，让鱼你在一起在此次疫情面前更能从容应对，连续推出一系列疫情应对机制。</p><p>当然，受新冠疫情影响，每一家餐饮都会难逃沉重打击，每一家企业都会面临种种困局。接下来，我们将从“三大行动，九大措施”多角度、多方面对鱼你在一起在疫情期间所作出的努力和措施，进行回顾详解。</p><p><strong>行动一：快速行动，第一时间成立防疫小组</strong></p><p>似乎谁也不曾料想此次疫情来势如此凶猛，自1月20日钟南山院士说出“人传人”，多省开启一级响应，中央也做出了统一部署后，有过非典和禽流感疫情经验的高层团队，立刻意识到新冠疫情也绝非如此简单。</p><p>未雨绸缪、快速行动是打好任何战役的前提，且不管疫情如何发展，但要防备万一疫情向不好的态势发展。于是，1月21日鱼你在一起总部便第一时间成立了“1号防疫行动”小组，并协同总部战略委员会成员，启动了新型冠状病毒一级响应预案。一方面及时关注疫情动态，一方面及时了解门店经营情况，同时制定应对预案和策略。</p><p><img src=\"https://yudianbao.ynzyq.cn/file/1633592127883.png\" style=\"max-width:100%;\" contenteditable=\"false\"/><br/></p><p><strong>行动二：响应防疫号召，全国门店下文自觉闭店</strong></p><p>1月23日，武汉全面封城。疫情发展之快，疫情严重了，餐饮业一定首当其冲。如何保障员工及其家庭防疫安全，如何响应国家号召避免就餐时的聚集，降低疫情扩散风险？</p><p>1月26日,为响应全国大防疫精神,确保餐厅无疫情扩散传播,<strong>鱼你在一起总部决定全国门店自觉闭店暂停营业</strong>。虽然闭店会影响门店生意，但是考虑到员工安全、各家门店要担起社会责任阻止疫情扩散，所以毅然决定下文要求门店闭店。</p><p>当然，门店是否能如期闭店，也跟当地政策和商场要求关系很大。我们开始紧急联系全国门店，运营部一对一的沟通，确认各地区门店的实际运营状况。如因各种原因不能闭店，在疫情期间要首先做好门店防疫措施，包括食材安全、门店消杀、无接触配送等等多个环节，以便确保全国门店的安全运营和避免疫情扩散。</p><p><img src=\"https://yudianbao.ynzyq.cn/file/1633592138866.png\" style=\"max-width:100%;\" contenteditable=\"false\"/><br/></p><p><strong>行动三：率先免管理费，助力加盟商递交减租申请</strong></p><p>谁也不知疫情何时结束，虽然已经闭店，但是全国门店仍要背负着房租、人工、原料成本这三座大山。对于现金流不宽裕的快餐门店而言，如何助力他们度过这艰难时刻？</p><p>1月29日，鱼你在一起总部第一时间率先决定发起“<strong>全国2020年一季度免收管理费</strong>”的支持行动,并竭尽全力帮助全国门店向商业综合体递交减租申请，<strong>向全国门店发出向业主主动提出减免房租的通知</strong>。</p><p>由于行动及时，我们的免管理费在行业内引起“减免”风潮，同时“抱团谈免租”也起到了很好的效果，全国共计五百家门店享受到了业主的房租减免，同时也诞生了一批如万达广场、华润万家等中国好房东。其中，万达广场一家企业就减免36家门店，共计120余万房租。</p><p><img src=\"https://yudianbao.ynzyq.cn/file/1633592149981.png\" style=\"max-width:100%;\" contenteditable=\"false\"/><br/></p><p><strong>九大措施之一：疫情期间防疫知识科普，助力门店自救</strong></p><p>因为疫情突然，很多门店加盟商短时间内对疫情手足无措。除了让全国门店落实闭店、协调业主减租外，更要稳心。作为总部，不仅要让全国门店加盟商更多了解此次疫情，了解如何应对，进而做到从态度上重视，从行动上积极应对，从心理上平和对待。</p><p>疫情初期，鱼你在一起总部不断向全国门店进行疫情知识、疫情动态、防疫知识、员工管理等科普知识进行下发，进而让全国门店正确对待这次疫情，不出现恐慌心理。在2月8日，魏总在“致鱼你在一起合作伙伴的一封信”中表示，疫情只能让我们更强大，大家要保持勇敢，坚定信心。</p><p>当然，除了防疫知识科普，要求他们做好疫情期间的安全管控之外，还要让全国门店开始自救，做好疫情期间搭建私域流量，塑造门店口碑，进而在疫情过后更快恢复。</p><p><strong>九大措施之二：实施疫情期运营门店监管，外卖无接触配送</strong></p><p>上文提到，对于极少数商场不让休市的门店，除了严格要求他们做好相关的员工、食安等防疫措施外，鱼你在一起总部还针对性下发了<strong>线上和线下两套防疫支持方案</strong>。</p><p>在线下店内，每名员工要严格进行体温监测、佩戴口罩，门店也要每天定时根据防疫要求进行消毒，进而从源头保障员工和菜品的安全。同时，为保证食客安全，还要做好外卖小哥的健康追踪，严测外卖小哥体温。另外，每一份外卖单上都会有“外卖安心卡”，提供无接触配送，食客可根据自身情况进行选择。</p><p><img src=\"https://yudianbao.ynzyq.cn/file/1633592160726.png\" style=\"max-width:100%;\" contenteditable=\"false\"/><br/></p><p>在线上外卖平台，为了支持营运的部分门店，总部分别在店面banner、公告、菜品图等方面，向顾客通过文字化、图片化和数字化的内容，告知店内针对疫情的动作，进而让顾客放心。同时，为了避免食材在空气中暴露所产生的风险，总部要求外卖都必须做严格的封口处理，进而降低疫情传播的风险。</p><p>&nbsp;</p><p><strong>三大行动九大措施，鱼你在一起全力打好这场防疫安全战</strong></p><p><strong>九大措施之三：店内食安防疫手册下发，全面打赢新冠疫情</strong></p><p>打好疫情防疫战，不仅要在战略上重视，更要在门店全面落实。面对全国上千家门店，如何才能让防疫食安标准落地，按照标准执行操作？</p><p>鱼你在一起总部多次下发<strong>“疫情期间门店防控手册”、“门店防疫操作标准及防疫物料摆放标准</strong>”等文件，并分别从门店员工防疫操作标准、顾客进店防疫标准、外卖防疫操作标准、门店物料摆放标准等多角度进行专项操作规范，同时以图文形式呈现，进而让全面门店看得懂，懂得如何落地。另外，运营部还安排专人监管，以便门店能百分百严格执行。在物料上，总部也分别准备了一系列宣传的内容，囊括消杀、安全、外卖等关键点。</p><p><img src=\"https://yudianbao.ynzyq.cn/file/1633592174376.png\" style=\"max-width:100%;\" contenteditable=\"false\"/><br/></p><p><strong>九大措施之四：线上培训全面启动，在危机中练内功</strong></p><p>疫情居家隔离期间，正是打根基，练基本功的时刻。为了树立全国门店打赢这次疫情的决心，同时练好运营基本功，鱼你在一起总部在此期间通过自有线上课堂，不断为大家安排丰富的线上学习内容。同时，还联合窄门学社、勺子课堂、创业酵母等平台全面开启线上学习课程，用知识的武器教会他们科学应对疫情，以及疫情后如何提升食安和门店营业业绩。</p><p><strong>九大措施之五：筹建“加委会”，建立总部和门店双向沟通桥梁</strong></p><p>目前多数连锁加盟品牌，全国不同区域的门店都是受大区管辖，并且以总部-门店单向沟通为主。为了更好的服务全国各地的加盟商门店，实现双向沟通无缝对接。</p><p>鱼你在一起总部决定快速成立加盟商委员会，简称加委会，并于2月29日通过线上远程会议召开了成立大会，并正式选举诞生了加委会会长和各位委员。</p><p>加委会的成立，不仅能提高总部与全国门店的沟通效率，快速解决各加盟店存在的共性问题，同时更能对部分门店有针对性提供定向帮扶，尤其是解决疫情后部分门店出现的实际问题。</p><p><strong>九大措施之六：线上暖心厨房23期互动，提升团队凝聚和向心力</strong></p><p>隔离在家，无论是员工还是全国门店加盟商，难免出现躁动。为了关爱员工，缓解千家门店几千员工的紧张情绪，自2月3号起，鱼你在一起总部在公众微信号每天开始发布“鱼你大厨秀”互动，研发部大厨每天教大家做一款菜。</p><p>与此同时，还在内部微信群，动员全员参与菜品制作中来，并进行充满趣味的PK。虽然只是简单一道菜，但是这种暖心行动，很大程度上提升了团队向心力和凝聚力，为战胜疫情增添了一份温情力量</p><p><img src=\"https://yudianbao.ynzyq.cn/file/1633592193153.png\" style=\"max-width:100%;\" contenteditable=\"false\"/><br/></p><p><strong>九大措施之七：防疫物资准备，满足员工和全国门店需要</strong></p><p>1月21日，在“1号防疫行动”小组成立的当天，鱼你在一起总部意识到，特殊时期，防疫物资最重要。于是，第一时间调集专项资金，成立以供应链部门为主的采购小组，快速采购口罩、额温枪、防护服、消毒液等防疫物资，以便满足和保障员工和全国合作伙伴的需要和安全。</p><p>值得一提的是，为了更好的把防疫物资送到大家手中，还为所有员工免费邮寄了口罩，进而让员工做好保护工作。</p><p><strong>九大措施之八：主动承担社会责任，对外捐款捐物70余万元</strong></p><p>除了把员工和全国门店加盟商的利益置于第一位外，在民生大义和全国共同抗击疫情的强烈社会责任感的驱使下，鱼你在一起及创始人魏总共计向社会捐赠口罩、消毒液、防护服、温度计等医疗物资，共计70万元。</p><p>在一次采访中，魏总表示，面对此次疫情，除了要照顾好企业这个小家，还要想着全国这个大家。<strong>国家给了我们每个人家的庇护,我们也要主动承担社会责任为国分忧</strong>。</p><p><img src=\"https://yudianbao.ynzyq.cn/file/1633592496228.png\" style=\"max-width:100%;\" contenteditable=\"false\"/><br/></p><p><strong>九大措施之九：打赢疫情后半场，“外卖半成品”配送新模式</strong></p><p>疫情之下，大多数门店停业，收入几乎为零。但在疫情的后半场，如何快速让已经开业的门店，快速实现增量，尽量平衡疫情期间的损失呢？</p><p>这次疫情让大多数家庭有了充足的在厨房做饭的时光，让部分人重新找到了在家做饭的幸福感和价值感。那么，作为一道标准化程度较高的酸菜鱼能否以半成品模式走进家庭呢？</p><p>于是，鱼你在一起总部在疫情后半场决定，把餐厅堂食的酸菜鱼制作成半成品用外卖渠道送到顾客家里，让顾客在家里也能享受到酸菜鱼的美味。经过半成品化的酸菜鱼，不仅免去各种食材的采购，更是免去杀鱼等繁琐环节，只需按照步骤操作就能成为一道美味。</p><p>就像魏总在内部分享中讲的那样，<strong>要意识到危机就是转机，用心捕捉危机中的转机。酸菜鱼外卖半成品，不仅能为门店短期提供增量，或许经过疫情，这种新模式也能成为门店长久的增量新模式。</strong></p><p><img src=\"https://yudianbao.ynzyq.cn/file/1633592506922.png\" style=\"max-width:100%;\" contenteditable=\"false\"/><br/></p><p>&nbsp;三大行动九大措施，鱼你在一起全力打好这场防疫安全战</p><p>“耐得住寂寞，忍得住孤独。疫情期间积蓄能量，迎接春暖花开。”这是魏总在内部分享中提到次数最多的一句话。</p><p>耐得住寂寞，主动闭店，居家隔离，不给国家添乱。忍得住孤独，抗住疫情之下门店收益的锐减。相信在此期间，通过多学习多思考，凝聚员工和抓人才，练好食安和运营内功，学会在危机中找转机，相信疫情过后，迎接大家的一定是春暖花开，品牌和大家更美好的未来。</p>', 1, 2, 1, 1, '2021-10-07 15:41:54', '2021-10-07 16:11:16');
INSERT INTO `notice` VALUES (19, '鱼你在一起三周年，品牌发展历程回顾', 1, 1, '<p><img src=\"https://yudianbao.ynzyq.cn/file/1633593400379.png\" style=\"max-width:100%;\" contenteditable=\"false\"/><br/>从2017年1月1日-2020年1月1日，鱼你在一起即将步入三周年。从2017年的初出茅庐，到2018年的高速发展，再到2019年的回归夯实基础。我们见证了鱼你在一起的成长。感恩遇见，荣誉满载。接下来让我们一起回顾三年来品牌发展历程。<br/></p><p><img src=\"https://yudianbao.ynzyq.cn/file/1633593411317.png\" style=\"max-width:100%;\" contenteditable=\"false\"/><br/><strong>2017年</strong><br/>1、鱼你在一起北京物美店开业，并召开品牌发布会<br/>2、集团总部与新东方烹饪教育达成战略合作<br/>3、北京电视台BTV《美食地图—一探到底》<br/>4、火爆探店鱼你在一起<br/>5、品牌广告荣登CCTV-1、CCTV-2、CCTV-7<br/></p><p><img src=\"https://yudianbao.ynzyq.cn/file/1633593423615.png\" style=\"max-width:100%;\" contenteditable=\"false\"/><br/><strong>2018年</strong><br/>1、鱼你在一起完成千店布局，全国门店突破1000家<br/>2、鱼你在一起荣登《2017年度中国快餐百强企业》<br/>3、荣登美国纽约时代广场纳斯达克和路透社大屏<br/>4、参与制定巴沙鱼中国团体标准<br/>5、品牌广告荣登CCTV-1、CCTV-2、CCTV-4、CCTV-7<br/>6、北京卫视《暖暖的味道》探店鱼你在一起<br/></p><p><img src=\"https://yudianbao.ynzyq.cn/file/1633593434098.png\" style=\"max-width:100%;\" contenteditable=\"false\"/><br/><strong>2019年</strong><br/>1、鱼你在一起荣获“2019CCFA连锁餐饮创新奖”<br/>2、鱼你在一起连续三年登录CCTV-1、湖南卫视、浙江卫视等黄金时段<br/>3、鱼你在一起荣获“2019中国酸菜鱼十大品牌”<br/>4、鱼你在一起荣获“世界川菜领军人物”，“世界川菜影响力品牌”<br/>5、鱼你在一起荣登《2018年度中国快餐企业70强》<br/>6、荣登“2019年度中国餐饮品牌力百强”<br/></p><p><img src=\"https://yudianbao.ynzyq.cn/file/1633593443153.png\" style=\"max-width:100%;\" contenteditable=\"false\"/><br/>三年时间，鱼你在一起不断夯实内功，实现量变到质变的飞跃，斩获荣誉无数，获得行业认可。2020年到来之际，鱼你在一起也将继续深耕、精耕营运之路，作为酸菜鱼快餐品类的推动者，充分发挥行业典范的作用，积极探索餐饮进化新模式，助力中国餐饮产业创新发展！<br/></p>', 1, 2, 1, 1, '2021-10-07 15:57:30', '2021-10-07 16:11:19');
INSERT INTO `notice` VALUES (20, '鱼你在一起深练内功，登榜2019中国餐饮品牌力百强', 1, 1, '<p>2019年12月4日，由世界中餐业联合会、红餐网联合举办的2019中国餐饮品牌力峰会(第23届红餐大会)以“品牌进化”为主线，解读了中国餐饮近十年来的品牌进化变迁。首届“中国餐饮红鹰奖”颁奖盛典也如期举行，在品牌力百强名单中，鱼你在一起等荣登榜单，成为中国餐饮的新有生力量，共同推动了中国餐饮的可持续发展和品牌进化。<img src=\"https://yudianbao.ynzyq.cn/file/1633593711331.png\" contenteditable=\"false\" style=\"font-size: 14px; max-width: 100%;\"/><br/>新晋百强餐饮品牌，“品牌进化”更具代表性<br/>在本次餐饮品牌力百强榜单中，一些近年来诞生的新晋品牌更是成为大家关注的焦点，其快速增长的品牌综合影响力更是成为大家学习和研究品牌进化的教科书。<br/>以酸菜鱼品类的“鱼你在一起”酸菜鱼而言，这家诞生不到三年的酸菜鱼品牌，就凭借其独特创新的商业模式、单品爆款、产品变革创新、快时尚属性成为餐饮“品牌进化”的代表，并通过不断输出多口味的产品、标准完善的营运、优质的服务等基本功，让品牌取得了较高的市场赞誉和用户口碑，并以一个品牌的力量推动了整个酸菜鱼品类的重燃，很好的实现了酸菜鱼进入快餐赛道的“品牌进化”。<br/></p><p><img src=\"https://yudianbao.ynzyq.cn/file/1633593737617.png\" style=\"max-width:100%;\" contenteditable=\"false\"/><br/>据记者了解，诞生于2017年初的鱼你在一起酸菜鱼，不仅突破了传统酸菜鱼大份模式，打造创新出了小份制酸菜鱼模式，更是在一开始就奠定了轻资产、时尚化、标准化、年轻化、单品爆款、快餐化的发展道路，开辟了酸菜鱼品类发展的“快餐赛道”新模式。<br/>滴水穿石，品牌力是综合内功提升的外在表现<br/>当然，中国餐饮百强品牌力的荣耀，并非一纸证书如此简单，而是其背后多年“深练运营内功”的积累展现，是一种滴水穿石，日积月累不断提升自我，从量变到质变的一个过程。<br/></p><img src=\"https://yudianbao.ynzyq.cn/file/1633593756197.png\" style=\"max-width:100%;\" contenteditable=\"false\"/><p>虽然鱼你在一起酸菜鱼诞生不到三年时间，但是而今已经遍布全国356个城市，成为名副其实的酸菜鱼快餐头部品牌。这背后，正是其在营运、营建、标准化、供应链、产品、人才、培训、品牌建设、服务等方面不断努力，不断夯实基础的体现。也正是这些内功的修炼，才得以让其受到行业和消费者的认同，成为品牌力较强的品牌<br/></p><p><img src=\"https://yudianbao.ynzyq.cn/file/1633593767916.png\" style=\"max-width:100%;\" contenteditable=\"false\"/><br/>从粗放到精细化、小而美，从分散的街边到进驻一线商超MALL，从大而全到细分单品化场景，从传统菜系到挖掘和开发新品类等，相信随着中国餐饮更加多维度的“品牌进化”，中国餐饮必将诞生更多的新晋有实力的有生力量，也相信以“鱼你在一起”为代表的新品牌，不仅能依靠敢于创新、不忘夯实内功的态度保持品牌的持续增长，更是能不负众望，积极探索餐饮进化新模式，为中国餐饮的发展贡献一份力量，助力中国餐饮产业转型、创新和健康发展。<br/></p>', 1, 2, 1, 1, '2021-10-07 16:03:07', '2021-10-07 16:11:14');
