DROP TABLE IF EXISTS `merchant_store`;
CREATE TABLE `merchant_store`  (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `UID` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '授权号',
  `NAME` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '门店名称',
  `MERCHANT_ID` int(11) NULL DEFAULT NULL COMMENT '加盟商标识',
  `SIGNATORY` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '签约人',
  `MOBILE` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '签约人电话',
  `SIGN_TIME` date NULL DEFAULT NULL COMMENT '签约时间',
  `ID_NUMBER` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '身份证号/营业执照号',
  `EXPIRE_TIME` date NULL DEFAULT NULL COMMENT '合同到期时间',
  `PROVINCE` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '省份',
  `CITY` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '城市',
  `AREA` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '区',
  `ADDRESS` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '详细地址',
  `STATUS` int(2) NULL DEFAULT NULL COMMENT '1、已签约2、在营3、未开业4、选址中5、复尺6、设计7、施工8、竣工9、解约10、迁址11、暂停营业\r',
  `CONTRACT_STATUS` int(255) NULL DEFAULT NULL COMMENT '合同状态 1进行中 2续约中3 待签署 4 签署合同 5解约中 6解约 7续约中(解约状态下)',
  `MANAGEMENT_EXPENSE` decimal(12, 2) NULL DEFAULT NULL COMMENT '管理费金额',
  `ALREADY_MANAGEMENT_EXPENSE` decimal(12, 2) NULL DEFAULT NULL COMMENT '下次合同续约已缴纳金额(主要是用户续约的时候做判断，如果已缴纳主管的管理费才可以进行续约)',
  `MERCHANT_LINK` int(2) NULL DEFAULT NULL COMMENT '商户通 1开通 2未开通',
  `MERCHANT_LINK_TIME` date NULL DEFAULT NULL COMMENT '商户通开通时间',
  `MERCHANT_LINK_END_TIME` date NULL DEFAULT NULL COMMENT '商户通到期时间',
  `CREATE_USER` int(11) NULL DEFAULT NULL COMMENT '创建人',
  `UPDATE_USER` int(11) NULL DEFAULT NULL COMMENT '修改人',
  `CREATE_TIME` datetime NULL DEFAULT NULL,
  `UPDATE_TIME` datetime NULL DEFAULT NULL,
  PRIMARY KEY (`ID`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 31 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '门店信息表' ROW_FORMAT = DYNAMIC;

