  `REMARK` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '备注',
  `REFUSE` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '拒绝原因',
  `APPLY_ID` int(11) NULL DEFAULT NULL COMMENT '申请区域经理id',
  `APPLY_NAME` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '申请区域经理姓名',
  `CREATE_TIME` datetime NULL DEFAULT NULL COMMENT '订单申请时间',
