DROP TABLE IF EXISTS `payment_order_master`;
CREATE TABLE `payment_order_master`  (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `MERCHANT_ID` int(11) NULL DEFAULT NULL COMMENT '商户标识',
  `MERCHANT_NAME` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '商户名称',
  `MERCHANT_STORE_ID` int(11) NULL DEFAULT NULL COMMENT '门店标识',
