  `REGIONAL_MANAGER_MOBILE` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '区域经理电话',
  `PAYMENT_TYPE_ID` int(11) NULL DEFAULT NULL COMMENT '缴费类型标识',
  `PAYMENT_TYPE_NAME` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '缴费类型名称',
  `TYPE` int(2) NULL DEFAULT NULL COMMENT '类型 1、系统生成 2、区域经理生成',
  `STATUS` int(2) NULL DEFAULT NULL COMMENT '订单状态1、待支付 2、支付成功 3、取消 4、审核拒绝(增对区域经理主动生成的订单，后台审核不通过时的状态)',
  `EXAMINE` int(2) NULL DEFAULT NULL COMMENT '订单是否在审核 1、未审核 2、审核中',
  `MONEY` decimal(12, 2) NULL DEFAULT NULL COMMENT '支付金额',
  `EXPIRE_TIME` date NULL DEFAULT NULL COMMENT '付款截止时间',
  `PAY_TIME` datetime NULL DEFAULT NULL COMMENT '支付时间',
  `SEND` int(2) NULL DEFAULT NULL COMMENT '是否推送 1推送给加盟商 2未推送给加盟商',
  `EXAMINE_NUM` int(2) NULL DEFAULT NULL COMMENT '需要几次审核',
  `REMARK` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '备注',
  `CREATE_TIME` datetime NULL DEFAULT NULL COMMENT '订单生成时间',
  `UPDATE_TIME` datetime NULL DEFAULT NULL COMMENT '订单修改时间',
  `CREATE_USER` int(11) NULL DEFAULT NULL COMMENT '如果是系统生成的话，该字段值为-1',
  `UPDATE_USER` int(11) NULL DEFAULT NULL,
  `NATURAL_YEAR_START` date NULL DEFAULT NULL COMMENT '缴纳后生效开始时间',
  `NATURAL_YEAR_END` date NULL DEFAULT NULL COMMENT '缴纳后生效到期时间',
  `DELETED` tinyint(1) NULL DEFAULT 0,
  PRIMARY KEY (`ID`) USING BTREE
